import ExpenseItem from "./ExpenseItem";

function Expenses(props){
    <div>
    <ExpenseItem title={props.title[0]}
    amount={props.amount[0]}
    date={props.date[0]}></ExpenseItem>
    </div>
}

export default Expenses;
